import 'dart:convert';
import 'dart:typed_data';

Uint8List get defaultUserImage {
  final base64String = String.fromCharCodes(_defaultUserImage.codeUnits);
  return base64Decode(
      base64String.replaceAll(RegExp(r'data:image\/(webp|png|jpeg|jpg);base64,'), ''));
}

const _defaultUserImage =
    'data:image/png;base64,';
